import React, { useEffect, useState } from "react";

export default function ListeStations({ url, setStationsData }) {
  var [stations, setStations] = useState([]);

  useEffect(() => {
    const fetchStations = () => {
      fetch(url)
        .then((response) => response.json())
        .then((data) => setStationsData(data.result.stations))
        .catch((e) => console.log("ERREUR : " + e));

    };
    fetchStations();
  }, [setStationsData]);

